import React, { useState } from 'react';

const initialItems = [
  { name: 'Apple', imageURL: 'apple.jpg', tier: 'S' },
  { name: 'Lemon', imageURL: 'lemon.jpg', tier: 'A' },
  // Add more items...
];

const TierList = () => {
  const [items, setItems] = useState(initialItems);

  return (
    <div className="tier-list">
      {items.map((item) => (
        <div key={item.name} className={`tier-item tier-${item.tier}`}>
          <img src={item.imageURL} alt={item.name} />
          <span>{item.name}</span>
        </div>
      ))}
    </div>
  );
};

export default TierList;
